import React from 'react';
import { Outlet, NavLink } from 'react-router-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHouse, faChartLine, faPlus } from '@fortawesome/free-solid-svg-icons'
import './App.css'

function App() {
  return (
    <div>
      <header>
        <div>
          <h1>SebMedia</h1>
        </div>
        <div>
          <NavLink 
            to="home" 
            style={isActive => ({
              color: isActive ? 'red' : 'blue',
              marginLeft: '5%'
            })}
          >
            <FontAwesomeIcon icon={faHouse}/>
          </NavLink>
          <NavLink 
            to="dashboard" 
            style={isActive => ({
              color: isActive ? 'red' : 'blue',
              marginLeft: '5%'
            })}
          >
            <FontAwesomeIcon icon={faChartLine}/>
          </NavLink>
          <NavLink 
            to="posts" 
            style={isActive => ({
              color: isActive ? 'red' : 'blue',
              marginLeft: '5%'
            })}
          >
            <FontAwesomeIcon icon={faPlus}/>
          </NavLink>
        </div>
      </header>
      <Outlet/>
    </div>
  );
}

export default App;
